CARAMEL CAKE/KUE SARANG SEMUT 

.
.
.
Bahan A:
500gr gula pasir 
500ml air panas 
.
.
Bahan B:
190ml(1/2kaleng SKM ukuran kaleng standart ya) Susu Kental Manis (SKM) 
11/2sdt Soda Kue 
.
.
Bahan C:
200gr Tepung terigu segita 
50gr Tepung Sagu Tani/t.tapioka
Ayak jadi satu ya
.
.
.
Bahan D:
6btr Telur 
Pecahkan dalam wadah
.
.
Bahan E:
100gr Margarine cair
.
.
CARBUT:
1.Taruh gula pasir dalam wajan biarkan sampai kecoklatan dan berbuih, kemudian masukkan setengah takaran air panas aduk2 kemudian baru masukkan lagi sisanya aduk2 -+5mnt sampai tidak ada sisa gulanya ya..dinginkan 
.
.
.

Siapkan cetakan Tulban diameter -+24cm, oles rata dgn margarin dan taburi tepung terigu, sisihkan.. 
Siapkan Oven, saya pakai oven tangkring ya.. 
2.Taruh dalam wadah bahan B /susu SKM dan soda kue, aduk memutar searah -+5mnt dgn balon wisk kemudian masukkan bahan C sedikit2 sambil diaduk2 sampai bahan C habis
3.Masukkan  Bahan D(telur) dgn memasukkan satu/satu telur, satu telur aduk dulu sampai rata, baru masukkan telur 3sdm berikut nya, lakukan sampai telur habis.. 
4.kemudian masukkan Bahan A (gulakaramel) Yg sudah dingin sedikit2 sambil terus diaduk memutar dgn balon wisk ,sampai tercampur rata, setelah rata masukkan margarin cair aduk lagi sampai tercampur rata juga ya gak perlu lama.. 
Adonan kue ini encer ya.. 
5.Masukkan adonan dlm Cetakan Tulban yg sdh diolesi ya
Lalu Oven sampai matang-+50mnt  atau sampai matang
Tusuk dgn lidi untuk memastikan kue sdh matang dgn tanda lidi tdk ada sisa adonan Yg lengket.. 
6.Angkat dan gerakkan cetakan matikan kue tdk lengket di cetakan kue kemudian Balik kue dgn loyang lain dan balik kembali dgn piring datar.. 
Tunggu dingin baru potong2..
Selamat mencoba.. 
